import { Database } from "../../Database/WholeData";

const Datas = Database.HomeData;

const Home = () => {
    const className = {
        container: "w-full h-full bg-background1 grayscale bg-top bg-blend-darken bg-black/40 bg-cover grid grid-cols-1 lg:grid-cols-2 p-10 font-Playfair_Display",
        innerBox: "w-full space-y-8 text-white",
        title: "text-4xl md:text-5xl font-bold",
        subtitle: "text-lg",
    }

    const Data = Datas.page_1;

    return(
        <div className={className.container}>
            <div></div>
            <div className={className.innerBox}>
                <h1 className={className.title}>
                    {Data.title}
                </h1>
                <p className={className.subtitle}>

                </p>
            </div>
        </div>
    )
}

export default Home;
